def even_or_odd(number):
    if number / 2 == 0:
        return "Even"
    if number / 2 != 0:
        return "Odd"

def upper_lower_count(str):
    upper_case = 0
    lower_case = 0
    for char in str:
        if char.isupper():
            upper_case += 1
        else:
            lower_case += 1
    return upper_case, lower_case

def multiply(numbers):
    total = 0
    for x in numbers:
        total *= x
    return total
